import React, { useState, useEffect } from "react";
import { getFiles } from "../services/fileServices"

const FilePage = () => {
  const [error, setError] = useState(null);
  const [files, setFiles] = useState(null);

  useEffect(() => {
    (async () => {
      try {
        const files = await getFiles();
        setFiles(files)
      }
      catch (e) {
        console.log(`[File Page] error fetching files`, e);
        setError(e);
      }
    })();
  }, []);

  console.log(files)

  return (
    <div className="p-5">
      <table class="table table-bordered">
        <thead>

          <tr>
            <th scope="col">File Name</th>
            <th scope="col">Text</th>
            <th scope="col">Number</th>
            <th scope="col">Hex</th>
          </tr>
        </thead>
        <tbody>
          <div class="d-flex justify-content-center w-full">
            <div class="spinner-border" role="status">
            </div>
          </div>
          {
            files?.map((file => {
              file?.lines.map(line => {
                return (
                  <tr>
                    <th scope="row">{file?.file}</th>
                    <th scope="row">{line?.text}</th>
                    <th scope="row">{line?.number}</th>
                    <th scope="row">{line?.hex}</th>
                  </tr>
                )
              })

            }))
          };
        </tbody>
      </table>
    </div >
  )

}

export default FilePage;
